    const[data,setData]=useState({
        age:'',
        gender:'',
        weight:'',
        height:'',
        neck:'',
        waist:'',
        hip:''
    })
    const options = {
        method: 'GET',
        url: 'https://fitness-calculator.p.rapidapi.com/bodyfat',
      
        params: {
        //   age:data.age,
        //   gender:data.gender,
        //   weight:data.weight,
        //   height:data.height,
        //   neck:data.neck,
        //   waist:data.waist,
        //   hip:data.hip
    age: '25',
    gender: 'male',
    weight: '70',
    height: '178',
    neck: '50',
    waist: '96',
    hip: '92'
        },
        headers: {
          'X-RapidAPI-Key': 'b3d275f402msh24baafd325292e0p12625ajsnc24a8e1a0737',
          'X-RapidAPI-Host': 'fitness-calculator.p.rapidapi.com'
        }
      };
   
      const fetchData = async (options)=>{
        const response = await fetch(options);
        const data = await response.json();
    
        return data;
    }
  return (
    console.log(data)
  )
}

export default BodyFatPercentage
